script: |
  super -f text -I q12672.spq | sort > q12672.out

inputs:
  - name: q12672.spq
    data: |
      SELECT DISTINCT + + 95 FROM tab0 (FORMAT parquet) AS cor0 WHERE col2 * - 17 NOT BETWEEN + + col0 AND - + CAST ( + ( - + 55 ) AS INTEGER );
  - name: tab0

outputs:
  - name: q12672.out
    data: |
      95
